import React from "react";
import {
    Button,
    Card,
    CardBody,
    CardImage,
    CardTitle,
    CardText,
    Col
} from "mdbreact";

export default class Device extends React.Component {
    constructor(props) {
        super(props);
        this.state = {};
    }
    render() {
        const { attributes } = this.props;
        let attributesHtml = attributes.map((att, idx) => {
            return <li key={idx}>{att.name}</li>;
        });
        let devices = this.props.devices.map((device, idx) => {
            return (
                <Col key={idx}>
                    <Card style={{ width: "22rem" }}>
                        <CardBody>
                            <CardTitle>{device.identifier}</CardTitle>
                            <CardText>
                                <div>
                                    <b>Indentifier</b>
                                    {device.identifier}
                                </div>
                                <div>
                                    <b>Owner</b>
                                    {device.owner}
                                </div>
                                <div>
                                    <b>Last Activity</b>
                                    {device.last_act}
                                </div>
                                <div>
                                    <b>Self Registered</b>
                                    {device.self_reg}
                                </div>
                                <div>
                                    <b>Attributes</b>
                                    <ul>{attributesHtml}</ul>
                                </div>
                            </CardText>
                            <Button>Button</Button>
                        </CardBody>
                    </Card>
                </Col>
            );
        });

        return <div className="devices-container">{devices}</div>;
    }
}
